import React, { Component } from 'react';
import { Link, BrowserRouter as Router, Route, Switch, withRouter } from 'react-router-dom'

class StatiquePage extends Component {
    constructor(props) {
        super(props);
        this.state = {}
    }
    render() {
        return (
            <div id="wrapper">
                {/* Navigation */}
                <nav className="navbar navbar-default navbar-static-top" style={{ marginBottom: 0 }}>
                    <div className="navbar-header"> <a className="navbar-toggle hidden-sm hidden-md hidden-lg " href="javascript:void(0)" data-toggle="collapse" data-target=".navbar-collapse"><i className="ti-menu" /></a>
                        <div className="top-left-part"><a className="logo" href="dashboard.html"><i className="glyphicon glyphicon-fire" />&nbsp;<span className="hidden-xs">My Admin</span></a></div>
                        <ul className="nav navbar-top-links navbar-left hidden-xs">
                            <li><a href="javascript:void(0)" className="open-close hidden-xs hidden-lg waves-effect waves-light"><i className="ti-arrow-circle-left ti-menu" /></a></li>
                        </ul>
                        <ul className="nav navbar-top-links navbar-right pull-right">
                            <li className="in">
                                <form role="search" className="app-search hidden-xs">
                                    <input type="text" placeholder="Search..." className="form-control" />
                                    <a href className="active"><i className="ti-search" /></a>
                                </form>
                            </li>
                            <li>
                                <a className="profile-pic" href="#"> <img src="images/users/hritik.jpg" alt="user-img" width={36} className="img-circle" /><b className="hidden-xs">Maruti</b> </a>
                            </li>
                        </ul>
                    </div>
                    {/* /.navbar-header */}
                    {/* /.navbar-top-links */}
                    {/* /.navbar-static-side */}
                </nav>
                <div className="navbar-default sidebar nicescroll" role="navigation">
                    <div className="sidebar-nav navbar-collapse">
                        <ul className="nav in" id="side-menu">
                            <li className="sidebar-search hidden-sm hidden-md hidden-lg">
                                <div className="input-group custom-search-form">
                                    <input type="text" className="form-control" placeholder="Search..." />
                                    <span className="input-group-btn">
                                        <button className="btn btn-default" type="button"><i className="ti-search" /> </button>
                                    </span>
                                </div>
                            </li>
                            <li>
                                <Link to="/Dashbord" className="waves-effect"><i className="glyphicon glyphicon-fire fa-fw" /> Dashboard</Link>
                            </li>
                        </ul>
                        <div className="center p-20">
                            <span className="hide-menu"><a href="http://wrappixel.com/templates/myadmin/" target="_blank" className="btn btn-info btn-block btn-rounded waves-effect waves-light">Upgrade to Pro</a></span>
                        </div>
                    </div>
                    {/* /.sidebar-collapse */}
                </div>
                {this.props.children}
                <footer className="footer text-center"> 2016 © Myadmin brought to you by themedesigner.in </footer>
                <footer className="footer text-center"> 2016 © Myadmin brought to you by themedesigner.in </footer>
            </div>
        );
    }
}

export default StatiquePage;
